trailingComments.value:
*
 * Permanent and session data storage.
 *
 * @example
 * const system = new StorageSystem({ id: 'my-game' });
 * system.load();
 * system.storage.score = (system.storage.score || 0) + 1;
 * system.save();

*
   * Destructor (disposes internal resources).
   *
   * @example
   * system.dispose();
   * system = null;

